/** @jsx jsx */
import { jsx, css } from "@emotion/core";
import React from "react";

const Overlay = () => <div css={styles} ></div>;

const styles = css`
  position: absolute;
  top: 0;
  right: 0;
  bottom: 0;
  left: 0;
  background: rgba(35, 45, 57, 0.8);
`;

export default Overlay;
